webpackJsonp([45468285325716],{365:function(e,a){e.exports={data:{markdownRemark:{html:'<h2>Ceremony</h2>\n<p>We will be holding a small ceremony with immediate family with a reception to follow.</p>\n<hr>\n<h2>Reception</h2>\n<p><strong>PLEASE NOTE: This will be an ADULT ONLY celebration.</strong></p>\n<p>You can think of our reception as a classy backyard cocktail party.</p>\n<p>The reception will be held outdoors under a large big-top tent. We will have a variety of table games and yard games set up, along with an open bar that will include wine, beer, liquor, soft drinks, and water. Snacks and endless appetizers will be offered all evening long. Please come hungry as there will be plenty of food!</p>\n<hr>\n<h2>What to wear</h2>\n<p>In keeping with the style of a classy backyard cocktail party, please see this guide as a reference for what to wear:</p>\n<img src="https://static1.businessinsider.com/image/5751b32991058427008c69f5-1041/jpmorgandresscodeskitch.jpg" />\n<p>Credit: <a href="https://www.businessinsider.com/jp-morgans-relaxed-dress-code-2016-6">Business Insider</a></p>\n<hr>\n<h2>Location and parking</h2>\n<p>The ceremony and reception will be held at <a href="https://goo.gl/maps/TCFZvhy9Jyx" target="_blank" rel="nofollow noopener noreferrer">1812 State Route 14A in Penn Yan, NY</a>.</p>\n<p><a href="https://www.google.com/maps/place/1812+NY-14A,+Penn+Yan,+NY+14527/"><img src="https://maps.googleapis.com/maps/api/staticmap?center=1812+NY-14A,+Penn+Yan,+NY+14527&zoom=14&scale=1&size=600x300&maptype=hybrid&format=png&visual_refresh=true&markers=size:mid%7Ccolor:0xff0000%7Clabel:%7C1812+NY-14A,+Penn+Yan,+NY+14527" alt="Google Map of 1812 NY-14A, Penn Yan, NY 14527"></a></p>\n<p>Guests may follow the driveway to the top of the hill and continue to follow the signs for parking in the backyard. </p>\n<p>Assistance will be provided to those with disabilities or those who have trouble walking.</p>\n<p>Please check the website for additional instructions in the event of rain.</p>',frontmatter:{title:"Wedding Day"},fields:{slug:"/wedding-day"},excerpt:"Ceremony We will be holding a small ceremony with immediate family with a reception to follow. Reception PLEASE NOTE: This will be an ADULTâ€¦"}},pathContext:{slug:"/wedding-day"}}}});
